var app = angular.module("compressImg", ['file']);


app.controller('name', function ($scope, $file) {
    var elem = document.querySelector('input#file');
    window.files = $file.init($scope, elem);
    var startImg = $scope.startImg = 'data:image/jpeg;base64,';
    $scope.comp = startImg;
    $scope.src = startImg;
    $scope.rate = 80;
    $scope.widthEditable = false;
    $scope.heigthEditable = false;

    $scope.dimension = {'width': 100, 'height': 100};
    $scope.compress = function () {
        $file.compress($file.imgTag, $scope.dimension);
    };
    $scope.toggle = function (state) {
        "use strict";
        $scope[state] = !$scope[state];
    }

    window.onresize = function (e) {
        window.setTimeout(function () {
            $scope.compress();

        }, 2000);
    }


});